import React from "react";
import { NavLink } from "react-router-dom";

const Weather = (props) => {
    const { title, poster } = props;
    return (
        <div className="weather">
            <NavLink>{title}
            <img src={`https://symbolsofindonesia.vercel.app/provinces/${poster}`} alt="" 
            />            
            </NavLink>
        </div>
    );
};

export default Weather;
